    "2016-02-26T22:17:14.442770",nt"name": "in-situ-navigational-physical-and-profile-data-collected-by-leibniz-institut-fur-meereswis",nt"isopen":
    false,nt"url": null,nt"notes": "In situ, navigational, physical and profile
    oceanographic data were collected, including CONDUCTIVITY, DEPTH - OBSERVATION,
    HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, SALINITY and WATER TEMPERATURE from Moored
    Buoy at the Tropical Eastern North Atlantic Time-Series Observatory (TENATSO) using
    CTD and pressure sensors from 2006-07-08 to 2008-02-19. These data were provided
    to one of the OceanSITES Data Assembly Centers (DAC). The DAC formatted this information
    into the OceanSITES file format and passed it on to the Global Data Assembly Centers
    (GDAC).OceanSITES is a worldwide system of long-term, open-ocean reference stations
    measuring dozens of variables and monitoring the full depth of the ocean from air-sea
    interactions down to the seafloor. It is a network of stations or observatories
    measuring many aspects of the ocean's surface and water column using, where possible,
    automated systems with advanced sensors and telecommunications systems, yielding
    high time resolution, often in real-time, while building a long record.",nt"license_title":
